angular.module('SNAP.controllers').controller('GalaxiesCategoryCtrl', ['$scope', '$timeout', 'ComponentMenuTitle', 'ComponentMenuList', 'DataManager', 'NavigationManager', 'ShellManager', function ($scope, $timeout, ComponentMenuTitle, ComponentMenuList, DataManager, NavigationManager, ShellManager) {

  var titleId = 'page-category-title';
  var contentId = 'page-category-content';
  var conainerId = 'page-category-content-container';

  var destinations = [];

  function renderTitle(element, data, destinations) {
    if (!element) {
      element = document.getElementById(titleId);
    }

    React.render(React.createElement(ComponentMenuTitle, {
      title: data.title,
      history: data.destinations
    }), element);
  }

  function renderContent(element, tiles) {
    if (!element) {
      element = document.getElementById(contentId);
    }

    React.render(React.createElement(ComponentMenuList, { tiles: tiles }), element);
  }

  function reset() {
    var container = document.getElementById(conainerId);
    if (container) {
      container.scrollLeft = 0;
    }
  }

  function renderData(items, entry) {
    var tiles = items.map(function (item) {
      var destination = {
        type: item.destination.type,
        token: item.destination.token,
        title: item.title
      };

      return {
        title: item.title,
        image: item.image,
        destination: destination
      };
    });

    var titleElement = document.getElementById(titleId),
        contentElement = document.getElementById(contentId);

    var data = {
      title: entry.title,
      destinations: destinations
    };

    if (titleElement && contentElement) {
      renderTitle(titleElement, data);
      renderContent(contentElement, tiles);
    } else {
      $timeout(function () {
        renderTitle(titleElement, data);
        renderContent(contentElement, tiles);
      });
    }
  }

  DataManager.menuChanged.add(function (menu) {
    if (!menu) {
      return;
    }

    renderData(menu.categories || [], menu);
  });

  DataManager.categoryChanged.add(function (category) {
    if (!category) {
      return;
    }

    var elements = (category.categories || []).concat(category.items || []);

    renderData(elements, category);
  });

  NavigationManager.locationChanging.add(function (location) {
    if (location.type === 'menu' || location.type === 'category') {
      destinations = DataManager.getDestinationPath(location);
    }

    DataManager.menu = location.type === 'menu' ? location.token : undefined;
    DataManager.category = location.type === 'category' ? location.token : undefined;

    $scope.showModal = location.type === 'item';
    $scope.visible = Boolean(DataManager.menu) || Boolean(DataManager.category) || Boolean($scope.showModal);

    $timeout(function () {
      return reset();
    });
  });
}]);

