//src/js/directives/quantity.js

angular.module('SNAP.directives').directive('quantity', ['$timeout', 'ShellManager', function ($timeout, ShellManager) {

  return {
    restrict: 'E',
    replace: true,
    scope: {
      quantity: '=',
      min: '@',
      max: '@',
      step: '@',
      appendix: '@'
    },
    link: function link(scope, elem) {
      scope.min = scope.min || 1;
      scope.max = scope.max || 9;
      scope.step = scope.step || 1;
      scope.appendix = scope.appendix || '';

      scope.decrease = function () {
        scope.quantity = scope.quantity > parseInt(scope.min) ? Math.max(scope.quantity - parseInt(scope.step), parseInt(scope.min)) : parseInt(scope.min);
      };

      scope.increase = function () {
        scope.quantity = scope.quantity < parseInt(scope.max) ? Math.min(scope.quantity + parseInt(scope.step), parseInt(scope.max)) : parseInt(scope.max);
      };
    },
    templateUrl: ShellManager.getPartialUrl('input-quantity')
  };
}]);

